  games_preprocessed |>
  ggplot(aes(x=averageweight, y=average))+
  geom_point(alpha = 0.25,size = 0.5, position = ggforce::position_jitternormal())+
  xlab("average weight")+
  ylab("average rating")

plot_bgg_ratings
